import React from "react";

const DisplaySkills = (props) => {
  const { skillsArray } = props;

  return (
    <div>
      {skillsArray.map((arr) => {
        return (
          <div key={arr.id}>
              <div class="blackLine"></div>
            <br></br>
            <div>{arr.skills}</div>
            <br></br>
            <div class="blackLine"></div>

          </div>
        );
      })}
    </div>
  );
};

export default DisplaySkills;
